// Получаем необходимые элементы
const filterItems = document.getElementById('filterItems');
const propertiesContainer = document.querySelector('#similar-properties #properties-list');

window.addEventListener('DOMContentLoaded', async () => {
    try {
        // Получаем список уникальных типов квартир и отображаем кнопки фильтрации
        const bedrooms = await fetchBedroomsList();
        createFilterButtons(filterItems, bedrooms);

        // Получаем список всех квартир и отображаем их
        const properties = await fetchAllProperties();
        updatePropertiesDisplay(propertiesContainer, properties);

        // Добавляем обработчики кликов на кнопки фильтрации
        const filterButtons = document.querySelectorAll('.filter-item');
        filterButtons.forEach(button => {
            button.addEventListener('click', () => {
                const bedrooms = button.dataset.bedrooms;
                // console.log(bedrooms);
                fetchFilteredProperties(propertiesContainer, bedrooms);
            });
        });
    } catch (error) {
        console.error(error);
    }
});

// Функция для получения списка типов квартир
async function fetchBedroomsList() {
    const response = await fetch('/bedrooms-list');
    return await response.json();
}

// Функция для получения всех квартир
async function fetchAllProperties() {
    const response = await fetch('/properties-list');
    return await response.json();
}

// Функция для фильтрации квартир и отображения результата
async function fetchFilteredProperties(propertiesContainer, bedrooms) {
    const response = await fetch('/properties-list');
    const properties = await response.json();
    const filteredProperties = bedrooms === 'all' ? properties : properties.filter(property => property.bedrooms.toString() === bedrooms);
    updatePropertiesDisplay(propertiesContainer, filteredProperties);
}

// Функция для обновления отображения квартир
function updatePropertiesDisplay(propertiesContainer, properties) {
    propertiesContainer.innerHTML = ''; // Очищаем контейнер перед обновлением

    if (Array.isArray(properties)) {
        const rowDiv = document.createElement('div');
        rowDiv.classList.add('row');

        properties.forEach(property => {
            const propertyElement = createPropertyElement(property);
            rowDiv.appendChild(propertyElement);
        });

        propertiesContainer.appendChild(rowDiv);
    } else if (typeof properties === 'object' && properties !== null) {
        const propertyElement = createPropertyElement(properties);
        propertiesContainer.appendChild(propertyElement);
    } else {
        console.error('Properties parameter is not an array or object');
    }
}

