// Функция для создания кнопок фильтрации
function createFilterButtons(filterItems, bedrooms) {
    // Очищаем существующие кнопки
    filterItems.innerHTML = '';

    // Создаем кнопку "All layouts"
    const allButton = document.createElement('div');
    allButton.classList.add('filter-item', 'current');
    allButton.dataset.bedrooms = 'all';
    allButton.textContent = 'All layouts';
    filterItems.appendChild(allButton);

    // Сортируем массив bedrooms в возрастающем порядке
    bedrooms.sort((a, b) => a - b);

    // Создаем кнопки для каждого типа квартир
    if (Array.isArray(bedrooms)) {
        bedrooms.forEach(bedroomsCount => {
            const button = document.createElement('div');
            button.classList.add('filter-item');
            button.dataset.bedrooms = bedroomsCount;
            button.textContent = `${bedroomsCount} ${bedroomsCount === '1' ? 'Bedroom' : 'Bedrooms'}`;
            filterItems.appendChild(button);
        });
    } else {
        console.error('Bedrooms parameter is not an array');
    }
}